import React from 'react'


import SideBar from './Sidebar'
import Main from './Main'

const Dashboard = ({handleLogout}) => {
    return (
        <div>
                
            <SideBar handleLogout={handleLogout}/>
            <button onClick={handleLogout}>Logout</button>
            <Main/>
        </div>
    )
}

export default Dashboard
